import { Products} from "../../data/FetchProducts";
import { SearchBar} from "../../components/SearchBar";
import { getUpdatedActiveIndex } from "react-bootstrap-typeahead/types/utils";



export const Store = ()  => {

  const [data, setData] = useState([]);
  const [searchResults, setSearchResults] = useState([]);

  useEffect(() => {
    getUpdatedActiveIndex ().then(json => {
      setData(json);
      return json
    }).then(json => {
      setSearchResults(json)
    })
  }, [])

  const content = " "

    return content (
      <>
        <div className="store">
        <div className="storeTitle"></div>
      <div className="container"> 
          <SearchBar data={data} setSearchResults={setSearchResults}/>
         <Products />


         </div>
      </div>
      </>
    )
}
